import React from "react";
import { useState, useEffect } from "react";
import { rutaAPI } from "../../config/Config";

import ProspectoModal from "./presentation/ProspectoModal";

export default function Modalcontainer({ prospecto }) {
  const [data, setData] = useState({});
  const [error, setError] = useState(null);

  useEffect(() => {
    // console.log("prospecto", prospecto);

    const fetchResource = async () => {
      try {
        let res = await fetch(`${rutaAPI}/mostrar-prospecto/${prospecto}`);
        let data = await res.json();

        console.log(data);
        setData(data.data);
      } catch (error) {
        setError(error);
      }
    };
    fetchResource();
  }, [prospecto]);

  return <ProspectoModal nombre={data.Prospect_Name} />;
}
